   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal><span style='font-size:12.0pt;line-height:105%;
    font-family:"Arial",sans-serif'>Son los 7 hijos de Karla y Saul Benedict, todos
    ellos adquieren un papel importante en la saga, es a través de ellos que se
    teje la historia a pesar de no participar mucho en algunos de los libros.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:12.0pt;line-height:105%;
    font-family:"Arial",sans-serif'>A pesar de que son muy parecidos ellos
    tienen personalidades y actitudes diferentes. Cuando uno de ellos necesita
    apoyo todos acuden para ayudarlo, con sus dones conectados son capaces de
    lograr cosas impresionantes. Aunque al principio tienen actitudes machistas
    la van perdiendo al integrar a sus almas gemelas a la familia y observan
    que son capaces de luchar y defenderse.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:12.0pt;line-height:105%;
    font-family:"Arial",sans-serif'><o:p>&nbsp;</o:p></span></p>
    </div>

   </tr>

  <![if !mso]>
  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif'>Tres de ellos (Zed, Yves y
    Xav) tienen su propio libro, donde cuentan partes importantes de su vida y
    el momento en el que conocieron a su alma gemela.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif'>Zed cuenta lo que sufría y
    causaba su comportamiento rebelde antes de conocer a Sky, además de lo que
    sintió por ella cuando la conoció, antes y después de descubrir que era su
    alma gemela.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif'>Ives cuenta la historia de
    porque es tan tranquilo y tarta de mantenerse fuera de los problemas,
    también relata como veía a Phoenix cuando la conoció y lo que sintió al
    descubrir su relación.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif'>Xav cuenta una experiencia
    que explica porque los savants deben mantenerse desapercibidos dentro de
    los humanos y la razón por la que estudia medicina, describe lo que sintió
    y como vio a Crystal cuando se conocieron. <o:p></o:p></span></p>
    <p class=MsoNormal><o:p>&nbsp;</o:p></p>
    </div>
    <![if !mso]></td>
   </tr>
  </table>
  <![endif]></v:textbox>

    <div>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif'>En los libros son
    descritos como afortunados por su apariencia, estatura, dones y habilidades
    que demuestran en la historia. <o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif'>Fueron nombrados por orden
    alfabético comenzando con la letra <i>T </i>que seguía del nombre de su padre
    (<b>S</b>aul). Utilizando nombres de origen extranjero debido a que sus
    padres tienen familia alrededor del mundo y a su madre le agrada lo
    extravagante.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:12.0pt;
    line-height:105%;font-family:"Arial",sans-serif'><o:p>&nbsp;</o:p></span></p>
    </div>
